import React from "react";
import "./career.css";

export default function ImagesSection() {
  const leftImages = [
    "/images/img1.jpg",
    "/images/img2.jpg",
    "/images/img3.jpg",
  ];

  const rightImages = [
    "/images/img5.jpg",
    "/images/img6.jpg",
    "/images/img7.jpg",
  ];

  return (
    <section className="images-section">
      <div className="images-layout">
        {/* Left Column */}
        <div className="image-column">
          {leftImages.map((src, i) => (
            <img key={i} src={src} alt={`Left ${i + 1}`} />
          ))}
        </div>

        {/* Center Content (paragraph + button) */}
        <div className="center-content">
          <p className="center-text">
            Discover our latest collection of amazing products. Quality and
            style in one place.
          </p>
          <button className="center-button">Shop Now</button>
        </div>

        {/* Right Column */}
        <div className="image-column">
          {rightImages.map((src, i) => (
            <img key={i} src={src} alt={`Right ${i + 1}`} />
          ))}
        </div>
      </div>
    </section>
  );
}
